
DROP TABLE INVENTARIO;

CREATE TABLE INVENTARIO (
  id number primary key,
  MEDICAMENTO_ID number default NULL,
  PUNTO_DE_VENTA_ID number default NULL,
  FECHA_ADQUISICION varchar2(255),
  FECHA_CADUCIDAD varchar2(255),
  CANTIDAD varchar2(50) default NULL,
  CONSTRAINT PUNTO_DE_VENTA_FK FOREIGN KEY(id) REFERENCES PUNTO_DE_VENTA(id),
  CONSTRAINT MEDICAMENTO_FK FOREIGN KEY(id) REFERENCES MEDICAMENTO(id) 
,100);


